import React from 'react'

function CharacterForm() {
  return (
    <div className='CharacterForm'>
        <form>
            <div>Новый персонаж</div>
            <Input placeholder='Имя'/>
            <Button>Создать</Button>
        </form>
    </div>
  )
}

export default CharacterForm
